  \"2013-03-16T00:20:23.553015\",\n\t\"name\": \"hydrogeology-of-the-bonneville-salt-flats-utah\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The investigation was undertaken to help
  evaluate the immediate and long-tenn potential of potash production at the Bonneville
  Salt Flats. The report includes a description of the hydrologic system of the salt
  flats, theories on its possible origin and predictions concerning the future of
  the system. The Bonneville Salt Flats are located near the Utah-Nevada border in
  the west part of the Great Salt lake Desert, where they occupy the west edge of
  a large flat playa (figures 1 and 2; Nolan, 1927).\",\n\t\"license_title\": null,\n\t\"extras\":
